import { AppShell, Navbar, Header, Text } from '@mantine/core';

const Layout = ({ children }) => {
  return (
    <AppShell
      navbar={<Navbar
        width={{ xs: 0, sm: 300 }}
        height={500}
      >
        <Text>Create</Text>
        <Text>Filter</Text>
      </Navbar>}
      header={<Header height={60} p="xs">


      </Header>}
    >
      {children}

    </AppShell>
  )
}

export default Layout;
